-- Group: report -- Name: Customer Profile Report - Customer -- Notes: MetaSQL statement for Header portion of CP report.
-- 20140929:rek chnaged query to crmacct to handle prospects also
SELECT crmacct_name as cust_name FROM crmacct WHERE crmacct_number = <? value("cust_num_param")?>;

-- Group: report -- Name: Customer Profile Report - Locations -- Notes: Locations with contact for CP report
--20140929:rek added code to return blank locations for prospects
SELECT (CASE WHEN char_length(shipto_addr.addr_line2) > 0 AND char_length(shipto_addr.addr_line3) < 1 THEN shipto_name||', '||shipto_addr.addr_line1||', '||shipto_addr.addr_line2 WHEN char_length(shipto_addr.addr_line2) > 0 AND char_length(shipto_addr.addr_line3) > 0 THEN shipto_name||', '||shipto_addr.addr_line1||', '||shipto_addr.addr_line2||', '||shipto_addr.addr_line3 ELSE shipto_name||', '||shipto_addr.addr_line1 END ||', '||shipto_addr.addr_city||', '|| shipto_addr.addr_state||' '||shipto_addr.addr_postalcode) AS shipto_NameAddress, shipto_cntct.cntct_name||', '||shipto_cntct.cntct_phone AS shipto_RecipientNameAddress, (CASE WHEN shipto_shipvia='Cust PU-Customer Pick-up' THEN 'X' END) AS shipto_custPU, (CASE WHEN shipto_shipvia<>'Cust PU-Customer Pick-up' THEN 'X' END) AS shipto_delivery, 1 as counter FROM crmacct LEFT JOIN custinfo ON crmacct_cust_id = custinfo.cust_id LEFT JOIN shiptoinfo ON shiptoinfo.shipto_cust_id = custinfo.cust_id LEFT OUTER JOIN addr shipto_addr ON shiptoinfo.shipto_addr_id = shipto_addr.addr_id AND shipto_active LEFT OUTER JOIN cntct shipto_cntct ON shiptoinfo.shipto_cntct_id = shipto_cntct.cntct_id WHERE crmacct_number = <? value("cust_num_param")?> AND (CASE WHEN char_length(shipto_addr.addr_line2) > 0 AND char_length(shipto_addr.addr_line3) < 1 THEN shipto_name||', '||shipto_addr.addr_line1||', '||shipto_addr.addr_line2 WHEN char_length(shipto_addr.addr_line2) > 0 AND char_length(shipto_addr.addr_line3) > 0 THEN shipto_name||', '||shipto_addr.addr_line1||', '||shipto_addr.addr_line2||', '||shipto_addr.addr_line3 ELSE shipto_name||', '||shipto_addr.addr_line1 END ||', '||shipto_addr.addr_city||', '|| shipto_addr.addr_state||' '||shipto_addr.addr_postalcode) is not null UNION SELECT null,null,null,null,2 order by counter;

-- 20140929:rek updated query to handle prospects -- 20141006:rek removed SOS for prospects, but added blank row.
drop table IF EXISTS temppdfMainConact;
CREATE TEMPORARY TABLE temppdfMainConact as SELECT cntct_id, cntct.cntct_first_name, cntct.cntct_last_name, cntct.cntct_title, cntct.cntct_phone, cntct.cntct_phone2, cntct.cntct_fax, cntct.cntct_email, (CASE WHEN char_length(addr.addr_line2) > 0 AND char_length(addr.addr_line3) < 1 THEN addr.addr_line1||', '||addr.addr_line2 WHEN char_length(addr.addr_line2) > 0 AND char_length(addr.addr_line3) > 0 THEN addr.addr_line1||', '||addr.addr_line2||', '||addr.addr_line3 ELSE addr.addr_line1 END ||', '||addr.addr_city||', '|| addr.addr_state||' '||addr.addr_postalcode) AS address, addr.addr_city, addr.addr_state, addr.addr_postalcode, 0 as state FROM custinfo JOIN custtype ON (cust_custtype_id=custtype_id) JOIN crmacct ON crmacct_cust_id = custinfo.cust_id JOIN cntct ON cntct.cntct_crmacct_id = crmacct.crmacct_id JOIN addr ON cntct.cntct_addr_id = addr.addr_id JOIN charass ON charass_target_id=cntct.cntct_id JOIN char ON charass_char_id = char_id WHERE cntct_active AND charass_target_type='CNTCT' AND char_name = 'CONTACT TYPE' AND charass_value = 'SOS' --AND cust_number = 'ALLEGH0005'; AND cust_number = <? value("cust_num_param") ?>; --ORDER BY cust_number;
INSERT INTO temppdfMainConact SELECT null,null,null,null,null,null,null,null,null,null,null,null,1;
select cntct_first_name,cntct_last_name,cntct_title,cntct_phone,cntct_phone2,cntct_fax,cntct_email ,address,addr_city,addr_state,addr_postalcode,state from temppdfMainConact,state ORDER BY state LIMIT 1;

drop table IF EXISTS temppdfOther;
CREATE TEMPORARY TABLE temppdfOther AS SELECT ('Other:') AS charass_value, (cntct.cntct_first_name||' '||cntct.cntct_last_name||' '|| cntct.cntct_phone) AS NamePhone, cntct.cntct_title, cntct.cntct_fax, CASE WHEN char_length(cntct_email)<19 THEN cntct_email WHEN char_length(cntct_email) > 37 THEN substring(cntct_email from 1 for 18)||' '||substring(cntct_email from 19 for 18)||' '||substring(cntct_email from 37 for char_length(cntct_email)) ELSE substring(cntct_email from 1 for 18)||' '||substring(cntct_email from 19 for char_length(cntct_email)) END AS email , (CASE WHEN char_length(addr.addr_line2) > 0 AND char_length(addr.addr_line3) < 1 THEN addr.addr_line1||', '||addr.addr_line2 WHEN char_length(addr.addr_line2) > 0 AND char_length(addr.addr_line3) > 0 THEN addr.addr_line1||', '||addr.addr_line2||', '||addr.addr_line3 ELSE addr.addr_line1 END ||', '||addr.addr_city||', '|| addr.addr_state||' '||addr.addr_postalcode) AS address, 1 AS TypeOrd
FROM custinfo JOIN custtype ON (cust_custtype_id=custtype_id) JOIN crmacct ON crmacct_cust_id = custinfo.cust_id LEFT JOIN cntct ON cntct.cntct_crmacct_id = crmacct.crmacct_id LEFT JOIN addr ON cntct.cntct_addr_id = addr.addr_id
WHERE cntct_active AND cntct.cntct_id not in (select charass_target_id from charass JOIN char ON charass_char_id = char_id WHERE charass_target_type='CNTCT' AND char_name = 'CONTACT TYPE' ) and (cntct.cntct_first_name||' '||cntct.cntct_last_name||' '|| cntct.cntct_phone) not like '1%' AND cust_number = <? value("cust_num_param") ?>;
INSERT INTO temppdfOther SELECT ('Other:') AS charass_value, (cntct.cntct_first_name||' '||cntct.cntct_last_name||' '|| cntct.cntct_phone) AS NamePhone, cntct.cntct_title, cntct.cntct_fax, CASE WHEN char_length(cntct_email)<19 THEN cntct_email WHEN char_length(cntct_email) > 37 THEN substring(cntct_email from 1 for 18)||' '||substring(cntct_email from 19 for 18)||' '||substring(cntct_email from 37 for char_length(cntct_email)) ELSE substring(cntct_email from 1 for 18)||' '||substring(cntct_email from 19 for char_length(cntct_email)) END AS email , ( CASE WHEN char_length(addr.addr_line2) > 0 AND char_length(addr.addr_line3) < 1 THEN addr.addr_line1||', '||addr.addr_line2 WHEN char_length(addr.addr_line2) > 0 AND char_length(addr.addr_line3) > 0 THEN addr.addr_line1||', '||addr.addr_line2||', '||addr.addr_line3 ELSE addr.addr_line1 END ||', '||addr.addr_city||', '|| addr.addr_state||' '||addr.addr_postalcode) AS address, 10 AS TypeOrd
FROM crmacct LEFT JOIN cntct ON cntct.cntct_id = crmacct.crmacct_cntct_id_1 LEFT JOIN addr ON cntct.cntct_addr_id = addr.addr_id WHERE cntct_active and (cntct.cntct_first_name||' '||cntct.cntct_last_name||' '|| cntct.cntct_phone) not like '1%' AND crmacct_number = <? value("cust_num_param") ?>;
INSERT INTO temppdfOther SELECT ('Other:') AS charass_value, (cntct.cntct_first_name||' '||cntct.cntct_last_name||' '|| cntct.cntct_phone) AS NamePhone, cntct.cntct_title, cntct.cntct_fax, CASE WHEN char_length(cntct_email)<19 THEN cntct_email WHEN char_length(cntct_email) > 37 THEN substring(cntct_email from 1 for 18)||' '||substring(cntct_email from 19 for 18)||' '||substring(cntct_email from 37 for char_length(cntct_email)) ELSE substring(cntct_email from 1 for 18)||' '||substring(cntct_email from 19 for char_length(cntct_email)) END AS email , ( CASE WHEN char_length(addr.addr_line2) > 0 AND char_length(addr.addr_line3) < 1 THEN addr.addr_line1||', '||addr.addr_line2 WHEN char_length(addr.addr_line2) > 0 AND char_length(addr.addr_line3) > 0 THEN addr.addr_line1||', '||addr.addr_line2||', '||addr.addr_line3 ELSE addr.addr_line1 END ||', '||addr.addr_city||', '|| addr.addr_state||' '||addr.addr_postalcode) AS address, 10 AS TypeOrd
FROM crmacct LEFT JOIN cntct ON cntct.cntct_id = crmacct.crmacct_cntct_id_2 LEFT JOIN addr ON cntct.cntct_addr_id = addr.addr_id WHERE cntct_active and (cntct.cntct_first_name||' '||cntct.cntct_last_name||' '|| cntct.cntct_phone) not like '1%' AND crmacct_number = <? value("cust_num_param") ?>;
INSERT INTO temppdfOther Select Null,Null,Null,Null,Null,Null,997;
